import Digonal from "./Digonal";
import {BrowserRouter, Routes,Route} from 'react-router-dom'


function App() {
  return (
    <div>


       <BrowserRouter>
          <Routes>
          <Route path='/' element={<DataTable1/>}/>
          <Route path='/assignment2' element={<Digonal/>}/>

          </Routes>
       </BrowserRouter>
    </div>
  );
}

export default App;
